import React, { useEffect }  from "react";
import axios from "axios";

function fetchingUsers() {
  const[data, setData]= userState([])
  useEffect(()=>{
    axios.get('http://127.0.0.1:8000/users/')
    .then(res => setData(res))
  })
}
